procstep.procdesc:
MassGIS received an export from MassDOT's Road Inventory on April 3, 2012, and further processed the data to facilitate display, particularly in OLIVER and the MassGIS Data Viewer. Processing included:
 - adding the CLASS, ADMIN_TYPE and RDTYPE items, used for line and route marker (shields) symbolization;
 - adding the ALTRTNUM<1-4> and ALTRT1TYPE items for enhanced route marker labeling;
 - adding the RT_NUMBER and STREET_NAME items so that existing applications that use these fields would continue to function.

MassGIS also produced the Major Roads and Major Routes layers from this statewide roads layer.
